import ReactDOM from "react-dom";
import video from './assets/video_bg.mp4';
import "./index.css";
import App from "./App";
import { BrowserRouter } from 'react-router-dom';

ReactDOM.render(
  <BrowserRouter>
    <App />
  </BrowserRouter>,
  document.getElementById("root")
);
